import Link from 'next/link';

const IntroPage = () => {
    return(
    <div className="content-container">
        <div className="title-wrapper">
            <h1 className="title">Yeah, quarantine sucks. <span>Big time.</span> But that doesn't mean that joy is cancelled.</h1>
            <Link href="/choice">
                <a className="global-button">Right?</a>
            </Link>
        </div>
        <style jsx>{`
            .content-container {
                margin: 2rem;
                height: 100vh;
            }
            .title-wrapper {
                display: grid;
                margin: 0 auto;
                width: 80%;
                justify-items: center;
                text-align: center;
            }
            .title {
                color: white;
            }
            .global-button {
                text-decoration: none;
                padding: 1rem;
                background-color: blue;
                color: white;
                border-radius .5rem;
            }
    `}</style>
    </div>
    )
}

export default IntroPage
